import React from 'react'

function Header() {
    return (
        <header className="text-center bg-warning">
            <h1>To Do List</h1>
            <div className="input-group mb-3">
                <input type="text"/>
                <button>Add Item</button>
            </div>
        </header>
    )
}

export default Header
